Painkiller Recurring Evil (2012) [RePack] [RUS/ENG]


RELEASE NOTES
 Battle never ceases in the realm known as Hell. This time around it's a
 battle for the freedom of your very soul. Will you be able to escape
 from the prison hidden in the darkest deepest chasm of Hell? Do you
 have enough courage to travel through the most dangerous and twisted
 areas which are infamous for their unsafety even among demons
 themselves? Are you prepared to significantly reduce the demonic
 population of these areas?

Instruction:
1. Run setup.exe
2. Choose language Russian or English from setup programm
3. Play

